import React from 'react';
import Profile from './Profile';
import * as axios from 'axios';

class ProfileContainer extends React.Component {

    componentDidMount() {
        axios.get()
    }

    render() {
        return (
            <div>
                <Profile {...this.props} />
            </div>
        );
    }
}

export default ProfileContainer;
